import React, { Component } from 'react';
import './App.css';
import Axios from 'axios'
import { Routes, Route, Router } from 'react-router-dom';
import Layout from "./components/layout";

import Home from './components/sub/home';
import Test from './components/sub/testRoute';
import NoPage from './components/sub/NoPage';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { apiResponse: "" };
  }

  render() {
    Axios({
      method: "GET",
      url: "https://lazy-cyan-basket-clam-veil.cyclic.app/testAPI",
      headers: {
        "Content-Type": "application/json"
      }
    }).then(res => {
      this.setState({ apiResponse: res.data })
    });
    return (
      <Router>
        <Routes>
          <Route path="/" element={<Layout/>}>
            <Route index element={<Home/>} />
            <Route path="testAPI" element={<Test/>} />
            <Route path="*" element={<NoPage/>} />
          </Route>
        </Routes>
      </Router>
    )
  };
}

export default App;
